import React from 'react'
import { BrowserRouter as Router, Route, Link } from 'react-router-dom'
import {Box, AppBar, Typography} from '@mui/material'
import dogLogo from '../assets/dogLogo.png'

function Navbar() {
    return (
        <AppBar 
            position="static" 
            color="inherit"
            sx={{
            borderRadius: 4,
            p: 2,
            my: 3,
            display: 'flex',
            flexDirection: 'row',
            // justifyContent: 'center',
            alignItems: 'center',
            }}
        >
            <Typography variant="h2" align="center" component={Link} to="/">
            PetSocial
            </Typography>
            <Box sx={{
            mx: 5,
            }}>
            <img
                src={dogLogo}
                alt="logo"
                height="75"
                // Image source: https://www.vecteezy.com/vector-art/5162048-cartoon-dog-walking-on-white-background "Dog Vectors by Vecteezy" submitted by user tigatelu
            />
            </Box>
        </AppBar>
    )
}

export default Navbar
